import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";

const Game = () => {
  return (
    <div>
      <h1>Tic Tac Toe</h1>
    </div>
  );
};

ReactDOM.render(<Game />, document.getElementById("root"));
